import NavBar from './components/NavBar.js';
import 'bootstrap/dist/css/bootstrap.min.css';
import ItemListContainer from './components/ItemListContainer';


function App() {
  return (
    <div className="App">
      <NavBar/>
      <ItemListContainer title="Desarrolla nuevas habilidades para lograr la tan ansiada sensación este es mi año"/>
    </div>
  );
}

export default App;
